// Test to check if Ash was or not in a grid position
func TestIfAshWasHere(t *testing.T) {
	var gridDriven = []position{{0, 1}, {1, 0}, {0, 0}, {1, 1}}
	ashPosition := position{1, 0}
	ashWasHere := checkIfAshWasHere(gridDriven, ashPosition)
	if ashWasHere == false {
		t.Errorf("Ash was not here: %d", ashPosition)
	}
	ashPosition = position{2, 0}
	ashWasNotHere := checkIfAshWasHere(gridDriven, ashPosition)
	if ashWasNotHere == true {
		t.Errorf("Ash was here: %d", ashPosition)
	}
}

// Test Ash's next valid movement
func TestAshNextValidMovement(t *testing.T) {
	ashPosition := position{1, 0}
	// to north
	ashNextPosition := position{1, 1}
	_ = getNextValidGridMovement(north, &ashPosition)
	if ashPosition != ashNextPosition {
		t.Errorf("Ash next position is not wright: %d", ashNextPosition)
	}
	// to east
	ashNextPosition = position{2, 1}
	_ = getNextValidGridMovement(east, &ashPosition)
	if ashPosition != ashNextPosition {
		t.Errorf("Ash next position is not wright: %d", ashNextPosition)
	}
	// to south
	ashNextPosition = position{2, 0}
	_ = getNextValidGridMovement(south, &ashPosition)
	if ashPosition != ashNextPosition {
		t.Errorf("Ash next position is not wright: %d", ashNextPosition)
	}
	// to west
	ashNextPosition = position{1, 0}
	_ = getNextValidGridMovement(west, &ashPosition)
	if ashPosition != ashNextPosition {
		t.Errorf("Ash next position is not wright: %d", ashNextPosition)
	}
	// invalid
	var invalidPosition byte = 33
	invalid := getNextValidGridMovement(invalidPosition, &ashPosition)
	if invalid == true {
		t.Errorf("Ash received and invalid position: %d", invalidPosition)
	}
}

