// Test move Ash to E
func TestMoveAshToE(t *testing.T) {
	movements := []byte("E")
	ashPosition = position{0, 0}
	gridDriven = []position{{0, 0}}
	capturedPokemons = 1
	// move Ash
	moveAsh(movements, &ashPosition)
	if capturedPokemons != 2 {
		t.Errorf("The count of Pokemons is wrong %d", capturedPokemons)
	}
}

