// Test move Ash to a journey
func TestMoveAshToAJourney(t *testing.T) {
	movements := []byte("")
	ashPosition = position{0, 0}
	gridDriven = []position{{0, 0}}
	capturedPokemons = 1
	invalidMovements = 0
	// move Ash
	moveAsh(movements, &ashPosition)
	if capturedPokemons != 8216 {
		t.Errorf("The count of Pokemons is wrong %d", capturedPokemons)
	}
	if invalidMovements != 16533 {
		t.Errorf("The count of invalid movements is wrong %d", capturedPokemons)
	}
}
